    "2015-12-20T18:32:57.003934",nt"name": "pacioos-nearshore-sensor-10-ns10-maunalua-bay-oahu-hawaii",nt"isopen":
    false,nt"url": null,nt"notes": "The nearshore sensors are part of the Pacific
    Islands Ocean Observing System (PacIOOS) and are designed to measure a variety of
    ocean parameters at fixed point locations along the south shore of Oahu. NS10 is
    located off the old pier in Maunalua Bay in Hawaii Kai. The instrument is a Sea-Bird
    Electronics model 16+ V2 coupled with a WET Labs ECO-FLNTUS combination sensor.
    The package is fixed to the pier at about 2m depth.",nt"license_title": null,nt"extras":
